content:
저도.. 친구가 
&#x27;노래방에 쉬즈건(팝송중 메탈노래)이 없어&#x27;
라고 했는데 
&#x27;노래방에 휴지걸이가 없다고?&#x27;
라고 했다가 두고두고 놀림당함.

봄이 초등학생 때 개싫다 진짜;;
나중에가선 좋아해서 괴롭힌거라고 하겠지;;;;;;;;;
진짜 저런거 개싫어

아니 봄이가 겨울이를 좋아한다는 걸로 포장해서 괴롭힌거임;;;
당하는 입장에선 울기도 했었다는데;;
얼마나 짜증날까

일주일만에 반갑다.
그래 고향을 떠나지 말고
지켜야지...................;

겨울이 마음이 너무 예쁘네요.

그 동안 있었던 상황을 해석해 보면 경쟁률이 너무 높아서 재수까지 해 가며 간신히 붙었는데, 막상 일 해 보니 다 쓰러져 가는 낡은 역사에 사람도 오지 않아서 눈 치우는 게 주 업무인 상황이잖아요. 목표가 송림역이었다고 해도 그 고생한 거에 비해 현실적인 면이 많이 속상할 상황인데 긍정적이고 밝아서 보기 좋아요.

아, 물론 봄이와 다시 만난 부분은 제외하고 쓴 글입니다. 이 부분은 가상의 요소이니까요 ^^;;

소세지 먹던기억에 
눈이 많이 내려  눈치우
러 왔다니 ...................;

왠지 남주 말이... 사진을 보낸 사람은 남주가 아닌가보네요?
내가 찍은 사진이긴 한데..... 하면서
겨울이에게 내가 보낸거라고 생각하는거냐고 묻는거보니....
만약 남주가 보낸게 아니라면..
사진을 보낸 짝궁음 대체 누구죠^^;
아님 보낸 사람이 자신이라고 믿는지 확인하고 싶어서 일부러 그렇게 물어본걸까요;;;

15년전의 ㅅ진 지금 보면 
참 ......잘 기억이 날까 
새 삼 좋지.............;

두 사람이 아주 다정하고
가까워진것 같다. 끝 까지 
잘 되어야 하는데,,,,,,,,,,,,,,,,,,,,;

그동안 수고 많었어요.
쉬게되어 서운한데.....
12월 다시봐요;

꿀오뎅작가님 반갑네요.
손목 상태가 많이 해복되었다니 다행&#x27;
앞으로 건강하세요.

작가님! 시즌3 첫편이네요! (추카추카^^) 겨울이가 쿵! 하는건 심쿵 하거죠? 너무 귀엽네요&gt;////&lt;
물론 봄이두 귀여워요 &gt;\\\\&lt; 
 요즘 이 만화 너무 재밌게 보고있는거 알고 계시죠? (제발 그렇다고 말해줘요ㅠ) 보는 제가 다 떨리네요 ㅎㅎ ㅇㅅㅇ

아 뭐야ㅜㅜㅜㅜ얘네 정말 귀여워ㅜㅜㅜㅜㅜ
잘됐다ㅠㅠㅠㅠㅋㅋㅋㅋㅋㅋ
근데, 인수도 난감해졌게따;;;;

불량 적은 양해 하자요,
총등학교때의 짝궁운 여원한
친구지,,,,,,,,,,,,,,,,,,;
